import React from "react";
import { Link } from "react-router-dom";

import Logo from "../Logo";

import Nav from "../Nav";

import "./HeaderMobile.css";

const Header = () => {
	return (
		<header className="mobile flex f-col jc-start">
			<div className="hamburger flex f-col">
				<span className="line line-01" />
				<span className="line line-02" />
				<span className="line line-03" />
			</div>
			<div className="menu">
				<Link to="/">
					<Logo color="dark" />
				</Link>
				<Nav />
			</div>
		</header>
	);
};

export default Header;
